export const Stats = () =>{


    const weekDays = [
        {day: 'Sun', id:1, prog:30},
        {day: 'Mon', id:2, prog:40},
        {day: 'Tue', id:3, prog:80},
        {day: 'Wen', id:4, prog:30},
        {day: 'Thu', id:5, prog:70},
        {day: 'Fri', id:6, prog:0},
        {day: 'Sat', id:7, prog:80}
    ]
    return (
        <div className="stats">
            <div className="title">
                <h3>Time spent on learning</h3>
            </div>

            <div className="days">
            {weekDays.map(day => 
            <>
                <div className="day" key={day.id}>
                <p>{day.day}</p>
                <div className="blackBack">
                    <div style={{height: `${day.prog}%`}} className="frontColor"></div>
                </div>
                </div>
            </>
        )}
            </div>
        </div>
    );
}
